import React from "react";
import useRefExample from "../src/useRef";

const useRefEx = () => {
  return (
    <div>
      <useRefExample
        primaryImg="/static/CommonLoon.jpg"
        secondaryImg="/static/CommonLoon.jpg"
      ></useRefExample>
      &nbsp;
      <br />
      <useRefExample src="/static/CrackingArt.jpg" alt="Hi"></useRefExample>
    </div>
  );
};

export default useRefEx;
